import React from 'react';
import './Auth.css'; // Import the shared CSS file

const Login = () => {
  return (
    <div className="form-container">
        <div className="logo-box mb-4">
          <img src="/logo.png" alt="ICA Logo" className="logo" />
        </div>
       <form className="form-content">
       <div className="form-group mt-4">
            <input type="text" className="form-control form-control-lg" placeholder="Username" />
          </div>
          <div className="form-group mt-4">
            <input type="password" className="form-control form-control-lg" placeholder="Password" />
          </div>
          <button type="submit" className="btn btn-danger w-100 p-3 mt-3">
          Log In
          </button>
                   
                </form>
                <div className="login-link mt-3">
          <p>Forgot Password ?</p>
        </div>
            </div>
     

  );
};

export default Login;
